import * as React from 'react';
import { SVGIcon } from '../SVGIcon';
export const FlickrIconConfig = {
  name: 'FlickrIcon',
  height: 512,
  width: 448,
  svgPath: 'M400 32H48C21.5 32 0 53.5 0 80v352c0 26.5 21.5 48 48 48h352c26.5 0 48-21.5 48-48V80c0-26.5-21.5-48-48-48zM144.5 319c-35.1 0-63.5-28.4-63.5-63.5s28.4-63.5 63.5-63.5 63.5 28.4 63.5 63.5-28.4 63.5-63.5 63.5zm159 0c-35.1 0-63.5-28.4-63.5-63.5s28.4-63.5 63.5-63.5 63.5 28.4 63.5 63.5-28.4 63.5-63.5 63.5z',
  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const FlickrIcon = props => {
  const newProps = Object.assign({
    config: FlickrIconConfig
  }, props);
  return React.createElement(SVGIcon, newProps);
};
export default FlickrIcon;
